import { Navigate } from 'react-router-dom';
import './BotoesInformacoes.css'

function BotoesInformacoes() {
    return(
        <div className='Botoes'>
<button>sair</button> <button onClick={()=>{
                Navigate("book", {state:{id:props.livro.id}})
            }}>localizar</button>
        </div>
    )
}
export default BotoesInformacoes;
